export default async function Home() {
  const response = await fetch("https://pokeapi.co/api/v2/pokedex/2/")
  const data = await response.json()

  data.map((pokemon) => (
    <li key={pokemon.entry_number}>{pokemon.pokemon_species.name}</li>
  ))

  return (
    <div>
      <ul>
        {data.map((pokemon) => (
          <li key={pokemon.entry_number}>{pokemon.pokemon_species.name}</li>
        ))}
      </ul>
    </div>
  )
}
